043c\u0438\u0440\u0435<\/a> \u043a\u043d\u044f\u0437\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%AE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87_%D0%91%D0%BE%D0%B3%D0%BE%D0%BB%D1%8E%D0%B1%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0410\u043d\u0434\u0440\u0435\u0439 \u042e\u0440\u044c\u0435\u0432\u0438\u0447 \u0411\u043e\u0433\u043e\u043b\u044e\u0431\u0441\u043a\u0438\u0439\">\u0410\u043d\u0434\u0440\u0435\u0439 \u0411\u043e\u0433\u043e\u043b\u044e\u0431\u0441\u043a\u0438\u0439<\/a> \u043f\u043e\u0441\u0442\u0440\u043e\u0438\u043b \u043f\u043e \u043e\u0431\u0440\u0430\u0437\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D1%8B%D0%B5_%D0%B2%D0%BE%D1%80%D0%BE%D1%82%D0%B0_(%D0%9A%D0%B8%D0%B5%D0%B2)\" title=\"\u0417\u043e\u043b\u043e\u0442\u044b\u0435 \u0432\u043e\u0440\u043e\u0442\u0430 (\u041a\u0438\u0435\u0432)\">\u0432\u043e\u0440\u043e\u0442 \u043a\u0438\u0435\u0432\u0441\u043a\u0438\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D1%8B%D0%B5_%D0%B2%D0%BE%D1%80%D0%BE%D1%82%D0%B0_(%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80)\" title=\"\u0417\u043e\u043b\u043e\u0442\u044b\u0435 \u0432\u043e\u0440\u043e\u0442\u0430 (\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440)\">\u0417\u043e\u043b\u043e\u0442\u044b\u0435 \u0432\u043e\u0440\u043e\u0442\u0430<\/a> \u0438 \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u044b\u0445 \u0441\u0442\u0435\u043d \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1478_%D0%B3%D0%BE%D0%B4\" title=\"1478 \u0433\u043e\u0434\">1478<\/a>&#160;\u2014 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0438\u044f\">\u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0438\u0438<\/a> \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_%D0%9F%D0%B0%D1%86%D1%86%D0%B8\" title=\"\u0417\u0430\u0433\u043e\u0432\u043e\u0440 \u041f\u0430\u0446\u0446\u0438\">\u0417\u0430\u0433\u043e\u0432\u043e\u0440\u0430 \u041f\u0430\u0446\u0446\u0438<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 \u0441\u0435\u043c\u044c\u0438 \u041c\u0435\u0434\u0438\u0447\u0438 \u0440\u0430\u043d\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B8%D1%87%D0%B8,_%D0%9B%D0%BE%D1%80%D0%B5%D0%BD%D1%86%D0%BE\" title=\"\u041c\u0435\u0434\u0438\u0447\u0438, \u041b\u043e\u0440\u0435\u043d\u0446\u043e\">\u041b\u043e\u0440\u0435\u043d\u0446\u043e \u041c\u0435\u0434\u0438\u0447\u0438<\/a> \u0438 \u0443\u0431\u0438\u0442 \u0435\u0433\u043e \u0431\u0440\u0430\u0442, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D1%83%D0%BB%D0%B8%D0%B0%D0%BD%D0%BE_%D0%9C%D0%B5%D0%B4%D0%B8%D1%87%D0%B8\" title=\"\u0414\u0436\u0443\u043b\u0438\u0430\u043d\u043e \u041c\u0435\u0434\u0438\u0447\u0438\">\u0414\u0436\u0443\u043b\u0438\u0430\u043d\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1607_%D0%B3%D0%BE%D0%B4\" title=\"1607 \u0433\u043e\u0434\">1607<\/a>&#160;\u2014 \u043d\u0430 \u043c\u044b\u0441\u0435 \u0413\u0435\u043d\u0440\u0438 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%80%D0%B3%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0438\u0440\u0433\u0438\u043d\u0438\u044f\">\u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u044f<\/a>) \u0432\u044b\u0441\u0430\u0434\u0438\u043b\u0438\u0441\u044c \u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0410\u043c\u0435\u0440\u0438\u043a\u0435 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0435 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0446\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1658_%D0%B3%D0%BE%D0%B4\" title=\"1658 \u0433\u043e\u0434\">1658<\/a>&#160;\u2014 \u0446\u0430\u0440\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447<\/a> \u0441\u0432\u043e\u0438\u043c \u0443\u043a\u0430\u0437\u043e\u043c \u043f\u043e\u0432\u0435\u043b\u0435\u043b \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B0%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B0%D1%88%D0%BD%D1%8F\" title=\"\u0421\u043f\u0430\u0441\u0441\u043a\u0430\u044f \u0431\u0430\u0448\u043d\u044f\">\u0421\u043f\u0430\u0441\u0441\u043a\u043e\u0439<\/a> \u0431\u0430\u0448\u043d\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%8C\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u041a\u0440\u0435\u043c\u043b\u044c\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u041a\u0440\u0435\u043c\u043b\u044f<\/a>, \u043f\u0440\u0435\u0436\u0434\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u0432\u0448\u0443\u044e\u0441\u044f \u0424\u0440\u043e\u043b\u043e\u0432\u0441\u043a\u043e\u0439.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1783_%D0%B3%D0%BE%D0%B4\" title=\"1783 \u0433\u043e\u0434\">1783<\/a>&#160;\u2014 \u0442\u0440\u0438\u043d\u0430\u0434\u0446\u0430\u0442\u0438\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%82%D1%85%D0%BE%D0%B2%D0%B5%D0%BD,_%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%B3_%D0%B2%D0%B0%D0%BD\" title=\"\u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d, \u041b\u044e\u0434\u0432\u0438\u0433 \u0432\u0430\u043d\">\u041b\u044e\u0434\u0432\u0438\u0433 \u0432\u0430\u043d \u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d<\/a> \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d \u043c\u0443\u0437\u044b\u043a\u0430\u043d\u0442\u043e\u043c \u043a\u043b\u0430\u0432\u0438\u0448\u043d\u044b\u0445 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u043e\u0432 \u043f\u0440\u0438\u0434\u0432\u043e\u0440\u043d\u043e\u0433\u043e \u043e\u0440\u043a\u0435\u0441\u0442\u0440\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BD%D0%BD\" title=\"\u0411\u043e\u043d\u043d\">\u0411\u043e\u043d\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1792_%D0%B3%D0%BE%D0%B4\" title=\"1792 \u0433\u043e\u0434\">1792<\/a>&#160;\u2014 \u0431\u044b\u043b\u0430 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0430 \u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u043e\u0437\u0432\u0443\u0447\u0430\u043b\u0430 \u043f\u0435\u0441\u043d\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%81%D0%B5%D0%BB%D1%8C%D0%B5%D0%B7%D0%B0\" title=\"\u041c\u0430\u0440\u0441\u0435\u043b\u044c\u0435\u0437\u0430\">\u041c\u0430\u0440\u0441\u0435\u043b\u044c\u0435\u0437\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1795_%D0%B3%D0%BE%D0%B4\" title=\"1795 \u0433\u043e\u0434\">1795<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044f<\/a> \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F_%D0%B8_%D0%A1%D0%B5%D0%BC%D0%B8%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u041a\u0443\u0440\u043b\u044f\u043d\u0434\u0438\u044f \u0438 \u0421\u0435\u043c\u0438\u0433\u0430\u043b\u0438\u044f\">\u041a\u0443\u0440\u043b\u044f\u043d\u0434\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1798_%D0%B3%D0%BE%D0%B4\" title=\"1798 \u0433\u043e\u0434\">1798<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0430\u043d\u043d\u0435\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043b\u0430 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0443 \u0416\u0435\u043d\u0435\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799_%D0%B3%D0%BE%D0%B4\" title=\"1799 \u0433\u043e\u0434\">1799<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0_%D1%80%D0%B5%D0%BA%D0%B5_%D0%90%D0%B4%D0%B4%D0%B0\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043d\u0430 \u0440\u0435\u043a\u0435 \u0410\u0434\u0434\u0430\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043d\u0430 \u0440\u0435\u043a\u0435 \u0410\u0434\u0434\u0430<\/a>. \u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b\u0430 \u043c\u0435\u0436\u0434\u0443 \u0440\u0443\u0441\u0441\u043a\u043e-\u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90._%D0%92._%D0%A1%D1%83%D0%B2%D0%BE%D1%80%D0%BE%D0%B2\" class=\"mw-redirect\" title=\"\u0410. \u0412. \u0421\u0443\u0432\u043e\u0440\u043e\u0432\">\u0410. \u0412. \u0421\u0443\u0432\u043e\u0440\u043e\u0432\u0430<\/a> \u0438 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0435\u0439 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D0%BE,_%D0%96%D0%B0%D0%BD_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80\" title=\"\u041c\u043e\u0440\u043e, \u0416\u0430\u043d \u0412\u0438\u043a\u0442\u043e\u0440\">\u0416.&#160;\u0412.&#160;\u041c\u043e\u0440\u043e<\/a>. \u0411\u0438\u0442\u0432\u0430 \u0441\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u043a\u0440\u0443\u043f\u043d\u043e\u0439 \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u0441\u043e\u044e\u0437\u043d\u0438\u043a\u043e\u0432 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D1%85%D0%BE%D0%B4_%D0%A1%D1%83%D0%B2%D0%BE%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0439 \u043f\u043e\u0445\u043e\u0434 \u0421\u0443\u0432\u043e\u0440\u043e\u0432\u0430\">\u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0445\u043e\u0434\u0430 \u0421\u0443\u0432\u043e\u0440\u043e\u0432\u0430<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1803_%D0%B3%D0%BE%D0%B4\" title=\"1803 \u0433\u043e\u0434\">1803<\/a>&#160;\u2014 \u0442\u044b\u0441\u044f\u0447\u0438 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/L%E2%80%99Aigle_(%D0%BC%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%B8%D1%82)\" title=\"L\u2019Aigle (\u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442)\">\u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\u0430<\/a>, \u0443\u043f\u0430\u043b\u0438 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%E2%80%99%D0%AD%D0%B3%D0%BB%D1%8C\" title=\"\u041b\u2019\u042d\u0433\u043b\u044c\">\u041b\u2019\u042d\u0433\u043b\u044c<\/a>. \u0421\u043e\u0431\u044b\u0442\u0438\u0435 \u0443\u0431\u0435\u0434\u0438\u043b\u043e \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0445 \u0443\u0447\u0451\u043d\u044b\u0445 \u0432 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0438 \u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1828_%D0%B3%D0%BE%D0%B4\" title=\"1828 \u0433\u043e\u0434\">1828<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%82%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1828%E2%80%941829)\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1828\u20141829)\">\u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 \u0432\u043e\u0439\u043d\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1860_%D0%B3%D0%BE%D0%B4\" title=\"1860 \u0433\u043e\u0434\">1860<\/a>&#160;\u2014 \u0412\u0430\u0434-\u0420\u0430\u0441\u043a\u0438\u043c \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u043c \u043e\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%BE-%D0%BC%D0%B0%D1%80%D0%BE%D0%BA%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1859%E2%80%941860)\" title=\"\u0418\u0441\u043f\u0430\u043d\u043e-\u043c\u0430\u0440\u043e\u043a\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1859\u2